import React from 'react';
import { Link } from 'react-router-dom';

const MangaItem = ({ manga, index, note }) => (
  <div className="item">
    <Link to={`/manga/${manga.id}`}>
      <img src={manga.image} alt={manga.titreFr} />
    </Link>
    <h2>{index} : {manga.titreFr}</h2>
    <p>Note : {note}/100</p>
  </div>
);

export default MangaItem;
